3=defensive lines.@@One of the critical positions have been recently 
4=bombarded by Soviet air power, and is in need of reinforcements. The 
5=Allied forces are sending into their newest weapon - the Heavy 
6=Artillery, which fires from incredible range.@@The artillery pieces 
7=are vulnerable to air power. Escort them, and ensure the line is held 
8=until further instructions. 

